import React from "react";
import { MDBContainer } from "mdbreact";
import DocsLink from "./../components/docsLink";


const books = () => {
  return (
    <MDBContainer>
      <DocsLink
        title="Books"
       
      />
     
    </MDBContainer>
  );
}
export default books;
